  return (
    <thead>
      <th class="table-top">{props.col1Tunnel}</th>
      <th class="table-top">{props.col2Tunnel}</th>
      <th class="table-top">{props.col3Tunnel}</th>
    </thead>
  );
}

export default HeaderTable3Col;
